(134,	236,	'MadameMichu',	'michu@md.com',	'',	'::1',	'2021-03-03 15:46:37',	'2021-03-03 15:46:37',	'depuis toute petite j\'ai pour habitude de me rendre dans cette gare et d\'acheter un sachet de bonbon. Cette tradition remonte de l\'année 1947, la guerre venait de finir et mon père malheuresement s\'en est allé. (paix à son âme). Nous avions pour habitude de venir avec ma mère nous acheter un sachet de sucrerie. j\'ai transmis cette tradition à ma fille qui l\'a transmetra à sa fille (si un jour elle déside de bien vouloir m\'en donnée une (c\'est une autre histopire mais que voulez-vous la jeunesse de nos jour c\'est plus celle d\'antan)).',	0,	'1',	'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/80.0.3987.122 Safari/537.36',	'comment',	0,	26),
(137,	232,	'MadameMichu',	'michu@md.com',	'',	'::1',	'2021-03-03 16:23:14',	'2021-03-03 16:23:14',	'Mon voisin qui a habité le bâtiment d’en face avait un fils qui s’occupé de vendre des maison sur le bord de l’autoroute. il avait pour habitude de donnée du pain au canard, je le voyais tout les jours avec sa poche à quignon de pain, et il me souriait en me me disant ‘Bien l’bonjour madame Michu, comment allez-vous aujourd’hui ? vous avez pas trop froid ?’ tout en nourrissant ces canard ou autre poisson que sais-je. il mort la semaine, les pompier l’on retrouvé dans son fauteuil la télécommande à la main. M’en dieux que c’est triste de mourir comme ça, retrouvé par les pompier car il c’était faché avec son fils pour une histoire grotesque de voiture.',	0,	'1',	'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/80.0.3987.122 Safari/537.36',	'comment',	0,	26),
(138,	228,	'MadameMichu',	'michu@md.com',	'',	'::1',	'2021-03-03 16:24:06',	'2021-03-03 16:24:06',	'Mon voisin qui a habité le bâtiment d’en face avait un fils qui s’occupé de vendre des maison sur le bord de l’autoroute. il avait pour habitude de donnée du pain au canard, je le voyais tout les jours avec sa poche à quignon de pain, et il me souriait en me me disant ‘Bien l’bonjour madame Michu, comment allez-vous aujourd’hui ? vous avez pas trop froid ?’ tout en nourrissant ces canard ou autre poisson que sais-je. il mort la semaine, les pompier l’on retrouvé dans son fauteuil la télécommande à la main. M’en dieux que c’est triste de mourir comme ça, retrouvé par les pompier car il c’était faché avec son fils pour une histoire grotesque de voiture.',	0,	'1',	'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/80.0.3987.122 Safari/537.36',	'comment',	0,	26),
